import React, { Fragment } from 'react'
import { Helmet } from 'react-helmet'
import Navbar8 from '../components/navbar8'
import Footer4 from '../components/footer4'
import './email-input.css'

const EmailInput = (props) => {
  const [email, setEmail] = React.useState('')
  const [subject, setSubject] = React.useState('')
  const [content, setContent] = React.useState('')
  const [isLoading, setIsLoading] = React.useState(false)

  const handleSubmit = (e) => {
    e.preventDefault()
    setIsLoading(true)
    // Here you would typically send the data to your backend
    console.log({ email, subject, content })
    setTimeout(() => setIsLoading(false), 2000) // Simulate API call
  }

  return (
    <div className="email-input-container">
      <Helmet>
        <title>Email Analysis | Superior Unique Pigeon</title>
        <meta property="og:title" content="Email Analysis" />
      </Helmet>
      
      <Navbar8
        page4Description={
          <Fragment>
            <span className="email-input-text">View scan result</span>
          </Fragment>
        }
        action1={
          <Fragment>
            <span className="email-input-text">Sign In</span>
          </Fragment>
        }
        link2={
          <Fragment>
            <span className="email-input-text">Email Input</span>
          </Fragment>
        }
        page1={
          <Fragment>
            <span className="email-input-text">Home</span>
          </Fragment>
        }
        link1={
          <Fragment>
            <span className="email-input-text">Home</span>
          </Fragment>
        }
        page4={
          <Fragment>
            <span className="email-input-text">Result</span>
          </Fragment>
        }
        page2={
          <Fragment>
            <span className="email-input-text">Email Input</span>
          </Fragment>
        }
        link4={
          <Fragment>
            <span className="email-input-text">/result</span>
          </Fragment>
        }
        page1Description={
          <Fragment>
            <span className="email-input-text">Go to the Home page</span>
          </Fragment>
        }
        page2Description={
          <Fragment>
            <span className="email-input-text">Input email content and subject</span>
          </Fragment>
        }
        link3={
          <Fragment>
            <span className="email-input-text">History</span>
          </Fragment>
        }
        page3={
          <Fragment>
            <span className="email-input-text">History</span>
          </Fragment>
        }
        page3Description={
          <Fragment>
            <span className="email-input-text">View scan history</span>
          </Fragment>
        }
        action2={
          <Fragment>
            <span className="email-input-text">Verify Identity</span>
          </Fragment>
        }
        link1Url="/"
      ></Navbar8>

      <div className="email-input-form-container">
        <h1 className="thq-heading-2">Email Analysis</h1>
        <p className="thq-body-large">Enter the email details to check for phishing attempts</p>
        
        <form onSubmit={handleSubmit} className="email-input-form">
          <div className="form-group">
            <label htmlFor="email" className="thq-body-small">Sender Email</label>
            <input
              type="email"
              id="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              className="thq-input"
              placeholder="sender@example.com"
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="subject" className="thq-body-small">Subject</label>
            <input
              type="text"
              id="subject"
              value={subject}
              onChange={(e) => setSubject(e.target.value)}
              className="thq-input"
              placeholder="Email subject"
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="content" className="thq-body-small">Email Content</label>
            <textarea
              id="content"
              value={content}
              onChange={(e) => setContent(e.target.value)}
              className="thq-textarea"
              placeholder="Paste the email content here..."
              rows="8"
              required
            />
          </div>

          <button 
            type="submit" 
            className="thq-button-filled"
            disabled={isLoading}
          >
            {isLoading ? 'Analyzing...' : 'Analyze Email'}
          </button>
        </form>
      </div>

      <Footer4
        link5={
          <Fragment>
            <span className="email-input-text">Sign In</span>
          </Fragment>
        }
        link3={
          <Fragment>
            <span className="email-input-text">History</span>
          </Fragment>
        }
        link1={
          <Fragment>
            <span className="email-input-text">Home</span>
          </Fragment>
        }
        link2={
          <Fragment>
            <span className="email-input-text">Email Input</span>
          </Fragment>
        }
        link4={
          <Fragment>
            <span className="email-input-text">Result</span>
          </Fragment>
        }
      ></Footer4>
    </div>
  )
}

export default EmailInput
